ICATE_FILE_CONFIGURE_THIS:"ASN/PEM sertifika dosyas\u0131n\u0131n ad\u0131n\u0131 girin. Uygulama Aray\u00fcz\u00fc ve Siebel Sunucusu aras\u0131ndaki SISNAPI ileti\u015fimlerini \u015fifrelemek i\u00e7in SSL veya TLS kullan\u0131yorsan\u0131z, bunu konfig\u00fcre edin.",INTL_LABEL_PROVIDE_THE_NAME_WHICH_CAN_IDENTIFY_THE_TRUSTED_AUTHORITY_WHO:"Sertifikay\u0131 d\u00fczenleyen g\u00fcvenilir yetkiliyi tan\u0131mlayabilecek ad\u0131 girin. Uygulama Aray\u00fcz\u00fc ve Siebel Sunucusu aras\u0131ndaki SISNAPI ileti\u015fimlerini \u015fifrelemek i\u00e7in SSL veya TLS kullan\u0131yorsan\u0131z, bunu konfig\u00fcre edin.",INTL_LABEL_PROVIDE_THE_NAME_OF_THE_PEM_PRIVATE_KEY_FILE_CONFIGURE:"PEM \u00f6zel anahtar dosyas\u0131n\u0131n ad\u0131n\u0131 girin. Uygulama Aray\u00fcz\u00fc ve Siebel Sunucusu aras\u0131ndaki SISNAPI ileti\u015fimlerini \u015fifrelemek i\u00e7in SSL veya TLS kullan\u0131yorsan\u0131z, bunu konfig\u00fcre edin.",INTL_LABEL_PROVIDE_THE_PASSWORD_TO_DECRYPT_THE_PRIVATE_KEY_FILE_CONFIGURE:"\u00d6zel anahtar dosyas\u0131n\u0131n \u015fifresini \u00e7\u00f6zecek parolay\u0131 girin. Uygulama Aray\u00fcz\u00fc ve Siebel Sunucusu aras\u0131ndaki SISNAPI ileti\u015fimlerini \u015fifrelemek i\u00e7in SSL veya TLS kullan\u0131yorsan\u0131z, bunu konfig\u00fcre edin.",INTL_LABEL_TICK_THIS_TO_ENABLE_PEER_AUTHENTICATION_DURING_THE_SSL_HANDSHAKE:"SSL anla\u015fmas\u0131nda i\u015f arkada\u015f\u0131 kimlik do\u011frulamas\u0131n\u0131 etkinle\u015ftirmek i\u00e7in bu alan\u0131 kullan\u0131n. Uygulama Aray\u00fcz\u00fc ve Siebel Sunucusu aras\u0131ndaki SISNAPI ileti\u015fimlerini \u015fifrelemek i\u00e7in SSL veya TLS kullan\u0131yorsan\u0131z, bunu konfig\u00fcre edin.",INTL_LABEL_TICK_THIS_TO_VERIFY_THAT_APPLICATION_INTERFACE_COMPUTER_MATCHES_WITH:"Uygulama Aray\u00fcz\u00fc bilgisayar\u0131n\u0131n sertifikada sunulan ana bilgisayar ad\u0131 ile e\u015fle\u015fti\u011fini do\u011frulamak i\u00e7in bu alan\u0131 i\u015faretleyin. Uygulama Aray\u00fcz\u00fc ve Siebel Sunucusu aras\u0131ndaki SISNAPI ileti\u015fimlerini \u015fifrelemek i\u00e7in SSL veya TLS kullan\u0131yorsan\u0131z, bunu konfig\u00fcre edin.",INTL_LABEL_PROVIDE_ANONYMOUS_USER_NAME_THIS_VALUE_MUST_NOT_BE_LEFT:"Anonim kullan\u0131c\u0131 ad\u0131n\u0131 girin. Bu de\u011fer bo\u015f b\u0131rak\u0131lmamal\u0131d\u0131r.",INTL_LABEL_PROVIDE_ANONYMOUS_PASSWORD_THIS_VALUE_MUST_NOT_BE_LEFT_EMPTY:"Anonim parolay\u0131 girin. Bu de\u011fer bo\u015f b\u0131rak\u0131lmamal\u0131d\u0131r.",INTL_LABEL_PROVIDE_TIME_THAT_A_CONNECTION_TASK_WAITS_FOR_A_MESSAGE:"Zaman a\u015f\u0131m\u0131na u\u011framadan \u00f6nce, bir ba\u011flant\u0131 g\u00f6revinin istemciden bir mesaj i\u00e7in bekleyece\u011fi s\u00fcreyi girin. Bu de\u011fer bo\u015f b\u0131rak\u0131lmamal\u0131d\u0131r.",INTL_LABEL_CHOOSE_AUTHENTICATION_TYPE_THIS_VALUE_MUST_NOT_BE_LEFT_EMPTY:"Kimlik do\u011frulama tipini girin. Bu de\u011fer bo\u015f b\u0131rak\u0131lmamal\u0131d\u0131r.",INTL_LABEL_PROVIDE_TRUST_TOKEN_WHICH_WILL_BE_USED_AS_PASSWORD_WHEN_SSO_OR_OAUTH:"\u00c7oklu oturum a\u00e7ma veya OAuth etkinse parola olarak kullan\u0131lacak g\u00fcven belirtecini sa\u011flay\u0131n. Belirtilen de\u011fer, de\u011ferin g\u00fcvenlik adapt\u00f6r\u00fc i\u00e7in tan\u0131ml\u0131 G\u00fcven Belirteci parametresinin de\u011ferine kar\u015f\u0131 d\u00fc\u015fmesi durumunda \u00f6zel g\u00fcvenlik adapt\u00f6r\u00fcne parola parametresi olarak iletilir. \u00c7oklu oturum a\u00e7ma veya OAuth etkinse bu de\u011fer bo\u015f b\u0131rak\u0131lmamal\u0131d\u0131r.",INTL_LABEL_PROVIDE_OAUTH_AUTHENTICATION_URL_THIS_VALUE_MUST_NOT_BE_EMPTY:"OAuth i\u00e7 g\u00f6zlem URL'si girin. OAuth konfig\u00fcre edildi\u011finde bu de\u011fer bo\u015f olmamal\u0131d\u0131r.",INTL_LABEL_PROVIDE_OAUTH_CLIENT_ID:"Bir Siebel \u0130stemci No'dur. OAuth Sunucusunda Siebel gizli bir istemci olarak kaydedildikten sonra \u0130stemci No al\u0131r\u0131z.",INTL_LABEL_PROVIDE_OAUTH_CLIENT_SECRET:"Bir Siebel \u0130stemci \u015eifresidir. OAuth Sunucusunda Siebel gizli bir istemci olarak kaydedildikten sonra \u0130stemci \u015eifresi al\u0131r\u0131z."
